import React from 'react';
import { MDBContainer, MDBMask, MDBBtn, MDBView, MDBRow, MDBCol, MDBCardBody, MDBIcon } from 'mdbreact';

class Services extends React.Component {
    render() {  
        if(this.props.data) {
            var fname = this.props.data.fname;
            var description= this.props.data.description;
            var occupation= this.props.data.occupation;
        }
        return (
            <section className="my-5 services" id="section1">   
                    <div className="Services_Wrapper">
                        <MDBContainer>
                            <MDBRow>
                                <MDBCol lg="12">
                                    <MDBRow className="mb-3">
                                        <MDBCol xl="12" md="12" size="12">
                                        <h1 className="h1-responsive font-weight-bold my-3 text-center">What I'm Doing</h1>
                                        <p className="text-italic text-center">I love what I do. I take great pride in what I do.</p>
                                        <MDBCard style={{ width: "22rem" }}>
                                            <MDBCardBody>
                                                <MDBCardTitle>Card title</MDBCardTitle>
                                                    <MDBCardText>
                                                        Some quick example text to build on the card title and make
                                                        up the bulk of the card&apos;s content.
                                                    </MDBCardText>
                                                <MDBBtn href="#">MDBBtn</MDBBtn>
                                            </MDBCardBody>
                                        </MDBCard>                                       
                                        </MDBCol>
                                    </MDBRow>                 
                                </MDBCol>
                            </MDBRow>
                        </MDBContainer>
                    </div>   
            </section>
        );
    }
}

export default Services;
